import React, { FC } from 'react';
import Logo from "../../images/Logo.svg";
import LinkedInIcon from "../../images/icons8-linkedin-circled-50.png";
import GitHubIcon from "../../images/icons8-github-50.png";
import CVIcon from "../../images/icons8-download-cv-48.png";


interface HeaderProps {}

const Header: FC<HeaderProps> = () => (
  <div className={"flex flex-row w-screen bg-slate-800 text-white py-4 px-12 justify-between items-center"}>
    <div>
      <img className={"w-16 h-16"} src={Logo} alt={"logo"}></img>
      {/* <div className={"prose prose-invert prose-md"}>WORK</div>
      <div className={"prose prose-invert prose-md"}>REVIEWS</div> */}
    </div>
    <div className={"text-3xl typewriter w-fit"}>My Name Is Alex Richards</div>
    <div className={"flex flex-row gap-8"}>
      <img className={"w-8 h-8"} src={LinkedInIcon} alt={"LinkedIn"}></img>
      <img className={"w-8 h-8"} src={GitHubIcon} alt={"Github"}></img>
      <img className={"w-8 h-8"} src={CVIcon} alt={"Download Resume"}></img>
    </div>
  </div>
);

export default Header;
